<script>
import detectMobile from 'is-mobile'
import Chart from '~/components/Chart'
import TopBar from '~/components/TopBar'
import coronaMapIcon from '~/assets/coronamap.png'

const TITLE = 'Corona Map'
const DARK_COLOR = '#372F45'
const MAIN_COLOR = '#ADABC9'

export default {
  head() {
    return {
      title: TITLE,
      meta: [
        { name: 'theme-color', content: DARK_COLOR }
      ]
    }
  },
  components: {
    Chart,
    TopBar
  },
  data() {
    return {
      isPageLoaded: false,
      isHuggyChatLoaded: false,
      colors: {
        mainColor: MAIN_COLOR,
        placeholderDark: '#838383'
      },
      els: {
        canvasDiv: null,
        canvasIframe: null
      },
      page: {
        title: '',
        icon: ''
      }
    }
  },
  computed: {
    containerClasses() {
      const classes = [this.$style.container]

      if (!this.isPageLoaded) classes.push(this.$style.loading)

      return classes
    },
    isMobile() {
      return detectMobile() || window.innerWidth < 768
    }
  },
  mounted() {
    const vm = this
    const options = {
      afterLoad() {
        vm.page.title = `<img src="${coronaMapIcon}" /> ${TITLE}`
        window.Huggy.hideButton()
        if (!vm.isMobile) window.Huggy.openBox()
        vm.els.canvasDiv = document.querySelector('.powerzap_chat_canvas')
        vm.els.canvasIframe = document.querySelector('.powerzap_chat_canvas_iframe')

        window.setTimeout(function () {
          vm.isHuggyChatLoaded = true
          vm.adjustHuggyChatPosition()
        }, 800)

        window.Huggy.subscribe('notification:message-received', () => {
          if (vm.isMobile) window.Huggy.openBox()
        })
      },
      widget_id: 20196,
      company: 18798,
      jsonConfig: 'https://config.huggy.chat/ddaea610-4f9b-41a0-bb52-6a40ecfe8112.json',
      contextID: '38bc586ffd7c9f7f0f34e931e54d1c1e',
      mainColor: this.colors.mainColor
    }

    if (!this.isMobile) options.defaultElement = this.$refs.widget

    if (window.Huggy && typeof window.Huggy.init === 'function') window.Huggy.init(options)

    this.isPageLoaded = true

    window.addEventListener('resize', this.adjustHuggyChatPosition())
  },
  destroyed() {
    window.removeEventListener('resize', this.adjustHuggyChatPosition())
  },
  methods: {
    openHuggyChat() {
      window.Huggy.openBox()
    },
    adjustHuggyChatPosition() {
      const { canvasDiv, canvasIframe } = this.els

      if (canvasDiv && canvasIframe) {
        [canvasDiv, canvasIframe].forEach(el => {
          if (!this.isMobile) el.style.display = 'block'
        })
      }
    }
  }
}
</script>

